import axios from "axios";
import authHeader from "./auth-header";

const baseURL = "http://localhost:5152";

const API_URL = "/api/v1/events";

const getAllEvents = () => {
  return axios.get(baseURL+API_URL, { headers: authHeader() });
};

const postService = {
  getAllEvents,
};

export default postService;
